import {Link} from 'react-router-dom';
import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <h1>
          BAP-YAK
        </h1>
        <img src={logo} className="App-logo" alt="logo" />
      </header>
      <body claasName="App-login">
        <ul>
          <li>
            <Link to="/main">LOGIN</Link>
          </li>
        </ul>
      </body>
    </div>


  );
}

export default App;
